import FamPic from './assets/img/fampic.jpeg'
function Contacts() {
    return (
        <div className="container-fluid page">
            <div>
                <img src={FamPic} style={{ height: "300px", width: "320px"}}/>
            </div>
        </div>
    );
}
export default Contacts;
